  \"2015-05-26T23:12:35.029684\",\n\t\"name\": \"nepanode-mapwarper\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This site is part of pilot effort at the
  US Department of Energy (DOE) - Office of NEPA Policy and Compliance to evaluate
  providing IT web services as a shared service, hosted on the cloud, and using only
  Free and Open Source Software (FOSS). The site is an integrated component of the
  larger NEPAnode project but is a stand alone service. The site allows users to upload
  static map images with no geographic data so that they can be accurately referenced/rectified
  on an webmap. This site allows for the revitalizing of otherwise unusable/archived
  maps such as historic maps, site surveys, site plans, etc. turning them into usable
  geographic data which is subsequently made available as a KML file for use in Google
  Earth/Maps and as a Web Mapping Service (WMS) for using in web-based webmapping
  application such as NEPAnode or in desktop GIS software.\",\n\t\"license_title\":
